  (item, next, index) => {
    if (index === 1) {
      item = (Suiter as any)[item].type;
    }
    // @ts-ignore
    return { ...item, ...(Suiter as any)[next].type };
  }
);

/**
 * 套件状态，整合所有设备状态
 */
export const SuitStatus = Array.from(Object.keys(Suiter)).reduce(
  // @ts-ignore
  (item, next, index) => {
    if (index === 1) {
      item = (Suiter as any)[item].status;
    }
    // @ts-ignore
    return { ...item, ...(Suiter as any)[next].status };
  }
);

